import React from "react";

import classes from './Card.module.css'
import Button from './Button'
import { items } from "../UI/data/Items";


const Card = props => {
    console.log(items)

    return (
        <div >
            <ul >
                {items.map(items => {
                    return (
                        <li>
                            <div className={classes.card}>
                                <img src={items.imageURL}></img>
                            </div>
                            <div>
                            {items.name}
                                {items.price} {items.Quantity}
                            </div>
                            < Button />
                        </li>)
                })
                }
            </ul>


        </div>
    )

};

export default Card;
